pub enum SimulatedReduce<D: ParserDefinition> {
    Reduce {
        states_to_pop: usize,
        nonterminal_produced: D::NonterminalIndex,
    },
    Accept,
}

pub enum ParseError<L, T, E> {
    InvalidToken {
        location: L,
    },
    UnrecognizedEOF {
        location: L,
        expected: Vec<String>,
    },
    UnrecognizedToken {
        token: (L, T, L),
        expected: Vec<String>,
    },
    ExtraToken {
        token: (L, T, L),
    },
    User {
        error: E,
    },
}
